# Compute pairwise alignment distance matrix
n = len(sequences)
print(n)
distance_matrix = np.zeros((n, n))

def sequence_distance(seq1, seq2):
    score = pairwise2.align.globalxx(seq1, seq2, one_alignment_only=True, score_only=True)
    return 1 - (score / max(len(seq1), len(seq2)))

for i in range(n):
    for j in range(i + 1, n):
        dist = sequence_distance(sequences[i], sequences[j])
        distance_matrix[i][j] = dist
        distance_matrix[j][i] = dist

# Cluster into 5 groups
clustering = AgglomerativeClustering(n_clusters=5, metric='precomputed', linkage='average')
labels = clustering.fit_predict(distance_matrix)

print("Cluster labels:")
print(labels)

# Save cluster labels to CSV
with open("influenza_clusters.csv", "w", newline="") as csvfile:
    writer = csv.writer(csvfile)
    writer.writerow(["Index", "ClusterLabel"])
    for i, (seq, label) in enumerate(zip(sequences, labels)):
        writer.writerow([i+1, label])